import React from "react";
import "./sidebar.css";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import SidebarChannel from "./sidebarChannel";
import AddIcon from "@mui/icons-material/Add";
import SignalCellularAltIcon from "@mui/icons-material/SignalCellularAlt";
const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar__top">
        <h3 className="text-xl">Clone Disc</h3>
        <ExpandMoreIcon />
      </div>
      <div className="sidebar__channels">
        <div className="sidebar__channelsHeader text-lg text-gray-400 p-4 justify-between items-center flex">
          <div className="flex space-x-4 flex-1 text-gray-500 items-center">
            <ExpandMoreIcon />
            <h2>Text-Channel</h2>
          </div>
          <AddIcon className="hover:text-white cursor-pointer" />
        </div>
        <div className="sidebar__channel">
          <SidebarChannel />
          <SidebarChannel />
          <SidebarChannel />
          <SidebarChannel />
          <SidebarChannel />
        </div>
      </div>
      <div className="text-green-500 text-2xl"><SignalCellularAltIcon/></div>
    </div>
  );
};

export default Sidebar;
